import React from 'react';
import { useAuth0 } from '@auth0/auth0-react';

function Login() {
  const { isAuthenticated, logout } = useAuth0();

  return (
    isAuthenticated && (
      <button
        onClick={() => {
          logout({ returnTo: window.location.origin });
        }}
      >
        Log in
      </button>
    )
  );
}

export default Login;
